import React from "react";
import hotelstyle from "../../../data/hotel_list.json";
import Hotelstyle from "./hotelstyle";

const Hotelstyles = () => {
  return (
    <div className="container">
      <h3>Homes guests love</h3>
      {hotelstyle.map((hotels) => {
        <Hotelstyle key={hotels.name} item={hotels}></Hotelstyle>;
      })}
    </div>
  );
};
export default Hotelstyles;
